task_message:
Fix references in V3 payloads

V3 API doesn't return any of the records more than 2 times. If a record
is already included in the response any other occurences will be
represented as a reference, ie. a hash with just an @href. Ember Data
doesn't play nice with such references as it needs an id to identify a
record.

The code in this commit traverses payloads from V3 API and adds an id to
each of the references that are present.

For example a following payload:

    {
      "@href": "/build/1",
      "@type": "build"
      "id": 1,
      "state": "passed",
      "branch": {
        "@href": "/repo/1/branch/master",
        "name": "master",
        "lastBuild": {
          "@href": "/build/1"
        }
      }
    }

Will be changed to:

    {
      "@href": "/build/1",
      "@type": "build"
      "id": 1,
      "state": "passed",
      "branch": {
        "@href": "/repo/1/branch/master",
        "name": "master",
        "lastBuild": {
          "@href": "/build/1",
          "id": 1
        }
      }
    }

In this case an "id" field was added to "branch.lastBuild" field.

Fix serializers to work with deep nested relationships

There's a problem in a way we normalize V3 records into JSON API format.
When we extract relationships from a top level resource, we don't
normalize any of the related records, which means that their
relationships are lost. Given a payload like this for a repository:

    {
      @type: 'repository',
      @href: '/repo/1'
      id: 1,
      current_build: {
        @type: 'build',
        @href: '/build/1'
        id: 1,
        jobs: [
          {
            @type: 'job',
            @href: '/job/1
            id: 1
          }
        ]
      }
    }

We would run normalize on the payload, we would loop through the
relationships (`current_build` only in this case) and add relationships
to a `relationships` property. Because we don't run `normalize` on the
`current_build` relationship, we don't get any info about related jobs.

This commit changes the V3 serializer to run `normalize` on related
records, so we essentially end up with a tree of records. After we do
this, we also add all of the records that have a `standard`
representation to the `included` array in order to siedload them into
the store (`relationships` hash is just a set of references to related
records, it isn't supposed to carry extended record info).
